import message from './Dialogs.module.css';
import {NavLink} from 'react-router-dom';


function DialogItem(props) {
    let path = "/dialogs/" + props.id;
    return (
        <div className={message.dialogs_item}>
            <NavLink to={path}>{props.name}</NavLink>
        </div>
    );
}

function Message(props) {
    return(
        <div className={message.message_item}>{props.content}</div>
    );
}

let dialogsData = [
    {id: 1, name: "Dimych",},
    {id: 2, name: "Evgeniy",},
    {id: 3, name: "Sasha",},
]
let dialogsElements = dialogsData.map( d => <DialogItem name={d.name} id={d.id}/>)


let messagesData = [
    {id: 1, message: "Hello",},
    {id: 2, message: "How are you?",},
    {id: 3, message: "Chel",},
]
let messagesElements = messagesData.map( m => <Message content={m.message} id={m.id}/>)


function Dialogs() {
    return(
        <div className={message.dialogs}>
            <div className={message.notify}>
                {dialogsElements}
            </div>
            <div className={message.paper_dial}>
                {messagesElements}
            </div>
        </div>
    );
}

export default Dialogs
